
DROP DATABASE IF EXISTS property_db;

CREATE DATABASE property_db;

USE property_db;

create table propertyDetails (
	id INT PRIMARY KEY,
	bed INT NOT NULL,
	bath INT NOT NULL,
	capacity INT NOT NULL, 
	about_the_space VARCHAR(10000) NOT NULL,
	amenities VARCHAR(50) NOT NULL,
	SA_bed INT NOT NULL,
	SA_description VARCHAR(50) NOT NULL
);


